$_MODULE['<{ets_cfultimate}prestashop>help_55deac9cea67b28b657a3414d491a1e5'] = 'Formulaire de contact';
$_MODULE['<{ets_cfultimate}prestashop>help_e78f8e3951507d3ad70bad04d263a0f6'] = 'Lorsque vous créez un nouveau formulaire de contact, si vous cliquez sur le lien [1]\"Ajouter un nouveau champ de saisie / ligne pour créer votre formulaire de contact\"[/1] et sélectionnez un champ de saisie, par défaut, ce champ de saisie sera placé sur une ligne de largeur complète (1 colonne)';
$_MODULE['<{ets_cfultimate}prestashop>help_44bc6f8a71dc89fff236e12f6f869244'] = 'Pour ajouter un champ de saisie reCAPTCHA, vous devez d\'abord activer reCAPTCHA. Accédez à [1]\"Réglages > Intégration > reCAPTCHA\"[/1], activez l\'option reCAPTCHA et entrez votre paire de clés.';
$_MODULE['<{ets_cfultimate}prestashop>help_fde06cf9e07c495e4089187d22fe1f8b'] = 'Pour savoir comment obtenir la clé de site et la clé secrète de reCAPTCHA, veuillez consulter la documentation de notre module.';
$_MODULE['<{ets_cfultimate}prestashop>help_f9654c9df3f610569dd727b769581e6f'] = 'Pour pouvoir répondre aux messages des clients directement sur le back-office, vous avez besoin de l\'adresse électronique de votre client. Lors de la création d\'un formulaire de contact, veillez à ajouter un champ de saisie de courrier électronique et à le marquer comme champ requis.';
$_MODULE['<{ets_cfultimate}prestashop>help_df8334930ebd39a1c1bd49057ddb3586'] = 'Configurations de email';
$_MODULE['<{ets_cfultimate}prestashop>help_439cf3a9e0342a20b68fcded2619e240'] = 'Pour obtenir les informations de votre formulaire de contact sur l\'email envoyé à l\'email de l\'administrateur ou du répondeur automatique, veuillez copier et coller les mail-tags respectives dans le champ [1]\"Corps du message\"[/1] dans [1]\"Formulaires de contact > Mail\"[/1] sous-onglet';
$_MODULE['<{ets_cfultimate}prestashop>help_853b64314f465e7a1ebc1c63287ac7f1'] = 'Pour recevoir le fichier en pièce jointe de votre client par courrier électronique, accédez à [1]\"Formulaires de contact > Mail\"[/1] et cochez la case [1]\"Fichier joint\"[/1].';
$_MODULE['<{ets_cfultimate}prestashop>help_7f83c7fcf109140ce437c3822fa1ce7a'] = 'Pour recevoir le fichier joint de votre client via l\'onglet \"Messages\", accédez à [1]\"Formulaires de contact > Réglages\"[/1] et activez l\'option [1]\"Enregistrer les pièces jointes\"[/1].';
